import React from 'react';
import './App.css';
import DataVisualization from './components/DataVisualization';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme/theme';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import MapComponent from './components/MapComponent';
import DemographicsPieChart from './components/DemographicsPieChart';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ flexGrow: 1 }}>
        <AppBar
          position="static"
          style={{
            background: 'linear-gradient(45deg, #ffb5a7 30%, #eac5b3 90%)',
          }}
        >
          <Toolbar>
            <Typography variant="h5" component="div" sx={{ flexGrow: 1 }}>
              Welcome to Nest Quest
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      {/* Hero Section */}
      <div
        className="hero-section"
        style={{
          backgroundSize: 'cover',
          color: '#fff',
          textAlign: 'left',
          padding: '60px',
        }}
      >
        <Typography variant="h3">Explore. Discover. Connect.</Typography>
        <Typography variant="subtitle1">
          Dive into the world of data and make informed decisions with Nest
          Quest.
        </Typography>
      </div>

      <Container maxWidth="lg">
        <Box my={4}>
          <Paper elevation={3}>
            <Box
              p={3}
              style={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                width: '100%',
              }}
            >
              <div style={{ width: '100%', maxWidth: '1100px' }}>
                {' '}
                <DataVisualization />
              </div>
              {/* Center the MapComponent */}
              <div
                style={{
                  width: '100%',
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                }}
              >
                <MapComponent />
              </div>
            </Box>

            <Box style={{ display: 'flex', justifyContent: 'center' }}>
              <DemographicsPieChart />
            </Box>
          </Paper>
        </Box>
      </Container>
      <Box mt={5} py={3} bgcolor="primary.main" color="primary.contrastText">
        <Container maxWidth="lg">
          <Typography variant="body1">Nest Quest ©2024</Typography>
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
